import React from 'react';
import { Grid,Stack,Typography,Box,useTheme} from '@mui/material';
import {DetailsOutlined,InsertDriveFileOutlined,EmailOutlined,PhoneIphoneOutlined} from "@mui/icons-material"
import "../../Themes/Home.css"

const Home = () => {
    const theme=useTheme();
    theme.typography.h5 = {
        fontSize: '0.8rem',
        [theme.breakpoints.up('sm')]: {
          fontSize: '2rem',
        },
      };
      theme.typography.caption = {
        fontSize: '0.7rem',
        [theme.breakpoints.up('sm')]: {
          fontSize: '1.2rem',
        },
      };

    return (

        <>
           <Grid container  justifyContent="center" alignItems="center" sx={{height:"100%"}}>

       <Grid xs={10} sx={{bgcolor:"#000000",height:"20%",color:"#ffffff",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3}}>
     <Stack direction="row" alignItems="center" sx={{height:"100%",p:1}}>
    <img  src="https://friendv.files.wordpress.com/2013/08/monica-geller.jpg" alt="Profile Picture" className="profileImg"/>
    <Box sx={{ml:2}}>
    <Typography variant="h5" sx={{fontWeight:"bold"}}>Monica Geller</Typography>
    <Typography variant="caption">Stylist</Typography>
    </Box>

     </Stack>
       </Grid>
       <Grid md={3} xs={5} sx={{bgcolor:"#000000",color:"#ffffff",height:"20%",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3,display:"flex",flexDirection: 'column',justifyContent:"Center",alignItems:"center"}}>

     <DetailsOutlined fontSize="large"/>
         <Typography variant="h6">Order Details</Typography>


       </Grid>
       <Grid xs={5} md={3} sx={{bgcolor:"#000000",ml:1,color:"#ffffff",height:"20%",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3,display:"flex",flexDirection: 'column',justifyContent:"Center",alignItems:"center"}}>
       <InsertDriveFileOutlined fontSize="large"/>
         <Typography variant="h6">File Center</Typography>
       </Grid>
       <Grid xs={5} md={3} sx={{bgcolor:"#000000",ml:1,color:"#ffffff",height:"20%",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3,display:"flex",flexDirection: 'column',justifyContent:"Center",alignItems:"center"}}>
       <EmailOutlined fontSize="large"/>
         <Typography variant="h6">Message Center</Typography>
       </Grid>
       <Grid xs={5} sx={{bgcolor:"#000000",ml:1,color:"#ffffff",height:"20%",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3,display:"flex",flexDirection: 'column',justifyContent:"Center",alignItems:"center"}}>
     <PhoneIphoneOutlined fontSize="large"/>
     <Typography variant="h6">Virtaul Appointment</Typography>

       </Grid>
       <Grid xs={5} sx={{bgcolor:"#000000",ml:1,color:"#ffffff",height:"20%",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3}}>
     Tryon Appointment
       </Grid>
           </Grid>
        </>
    )
}

export default Home
